The script runs the SuperLU_DIST application, a parallel sparse direct linear solver. It utilizes the following software and resources:

- **Operating System:** Linux
- **Hardware:** Cori Haswell nodes
- **MPI Implementation:** OpenMPI 4.0.1
- **Compilers:** GNU compilers (gcc 8.3.0)
- **Libraries:** Intel Math Kernel Library (MKL), parmetis-4.0.3
- **Python Environment:** Python 3.7 with Anaconda 2019.10
- **Other Dependencies:** scikit-optimize, mpi4py, GPTune
- **Resource Allocation:**
    - 16 nodes
    - 32 cores per node
    - 2 hours wall time
- **Tuning Framework:** GPTune
- **Number of Runs:** 20
- **Number of Processes Per Node (Minimum):** 1
